cess\"\r\n                            }\r\n                        }\r\n                    ]\r\n                },\r\n                \"mergeTask\" : {\r\n                    \"displayName\": \"myMergeTask\",\r\n                    \"commandLine\": \"/bin/bash -c 'ls'\",\r\n                    \"resourceFiles\": [\r\n                        {\r\n                            \"autoStorageContainerName\": \"fgrp-[parameters('outputData')]\"\r\n                        }\r\n                    ]\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n",
